import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import { Carousel, ListGroup, Nav, Navbar, Container, NavDropdown} from 'react-bootstrap';
import { BrowserRouter as Router, Routes, Route, Link} from 'react-router-dom';
import Barra from "../Elementos/Navbar"
import '../css/anime.css'

export function templateAnime({LinkComics, tituloComic}){
    return(
        <div>
            <Barra/>
            <div class="Video">
                <iframe width="1268" height="713" src="https://www.youtube.com/embed/mOmczexloR8" title="HxH1" frameborder="1" allowfullscreen></iframe>
            </div>
        </div>
    );
}

export default templateAnime;
